import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Ajustes from './pages/Ajustes';
import Index from './pages/Index';
import About from './pages/About';
import Users from './pages/Users';


const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Index />} />
        <Route path="/Ajustes" element={<Ajustes />} />
        <Route path="/about" element={<About />} />
        <Route path="/users" element={<Users />} />
      </Routes>
      <nav>
        <ul>
          <li>
            <a href="/">Gráfico</a>
          </li>
          <li>
            <Link to="/Ajustes">Ajustes</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/users">Users</Link>
          </li>
        </ul>
      </nav>
      <div class="bottomLinkWrappper">
          <a href="/" class="bottomLink" target="_blank">Gráfico</a>
          <Link href="/Informe" class="bottomLink">Informe</Link>
          <Link to="/Ajustes" class="bottomLink" target="_blank">Ajustes</Link>
          <Link href="/ritmo/jc" class="bottomLink">Pantalla JC</Link>
      </div>
    </Router>
  );
};

export default App;
